import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

const HousingAdd = () => {
  const navigate = useNavigate();
  const House_API = 'http://26.90.237.200:3000/admin/house/add';

  const [id, setId] = useState('');
  const [addHousePlan, setAddHousePlan] = useState('');
  const [addNumDeed, setAddNumDeed] = useState('');
  const [addLandArea, setAddLandArea] = useState(0);
  const [addPrice, setAddPrice] = useState(0);
  const [addNote, setAddNote] = useState('');
  const [addStatus, setAddStatus] = useState(0);
  const [addImage, setAddImage] = useState(null);
  const [addidFK, setAddidFK] = useState(0);

  const addHouse = async () => {
    const data = {
      id: id,
      addHousePlan: addHousePlan,
      addNumDeed: addNumDeed,
      addLandArea: addLandArea,
      addPrice: addPrice,
      addNote: addNote,
      addStatus: 0,
      addImage: addImage,
      addidFK: addidFK,
    };

    try {
      const response = await axios.post(House_API, data);
      console.log(response.data);
    } catch (error) {
      console.error(error);
    }
    navigate('/Housing');
  };

  return (
    <div className="container">
      <form>
        <div className="mb-3">
          <div>
            <label htmlFor="id" className="form-label">
              รหัส
            </label>
            <input
              type="text"
              className="form-control"
              id="id"
              value={id}
              onChange={(e) => setId(e.target.value)}
            />
          </div>
          <div>
            <label htmlFor="addHousePlan" className="form-label">
              แปลนบ้าน
            </label>
            <input
              type="text"
              className="form-control"
              id="addHousePlan"
              value={addHousePlan}
              onChange={(e) => setAddHousePlan(e.target.value)}
            />
          </div>
          <div>
            <label htmlFor="addNumDeed" className="form-label">
              เลขที่โฉนด
            </label>
            <input
              type="text"
              className="form-control"
              id="addNumDeed"
              value={addNumDeed}
              onChange={(e) => setAddNumDeed(e.target.value)}
            />
          </div>
          <div>
            <label htmlFor="addLandArea" className="form-label">
              ขนาดพื้นที่
            </label>
            <input
              type="number"
              className="form-control"
              id="addLandArea"
              value={addLandArea}
              onChange={(e) => setAddLandArea(parseInt(e.target.value))}
            />
          </div>
          <div>
            <label htmlFor="addPrice" className="form-label">
              ราคา
            </label>
            <input
              type="number"
              className="form-control"
              id="addPrice"
              value={addPrice}
              onChange={(e) => setAddPrice(parseInt(e.target.value))}
            />
          </div>
          <div>
            <label htmlFor="addNote" className="form-label">
              หมายเหตุ
            </label>
            <input
              type="text"
              className="form-control"
              id="addNote"
              value={addNote}
              onChange={(e) => setAddNote(e.target.value)}
            />
          </div>
          <div>
            <label htmlFor="addStatus" className="form-label">
              สถานะการขาย
            </label>
            <input
              type="number"
              className="form-control"
              id="addStatus"
              value={addStatus}
              onChange={(e) => setAddStatus(parseInt(e.target.value))}
            />
          </div>
          <div>
            <label htmlFor="addImage" className="form-label">
              รูปภาพ
            </label>
            <input
              type="file"
              className="form-control"
              id="addImage"
              onChange={(e) => setAddImage(e.target.files[0])}
            />
          </div>
          <div>
            <label htmlFor="addidFK" className="form-label">
              รหัส FK
            </label>
            <input
              type="number"
              className="form-control"
              id="addidFK"
              value={addidFK}
              onChange={(e) => setAddidFK(parseInt(e.target.value))}
            />
          </div>
        </div>
        <button type="button" className="btn btn-primary" onClick={addHouse}>
          เพิ่มบ้าน
        </button>
      </form>
    </div>
  );
};

export default HousingAdd;
